def reverse_sequence(dna_sequence):
    reversed_sequence = ""
    for char in dna_sequence:
        reversed_sequence = char + reversed_sequence
    return reversed_sequence

def complement_sequence(dna_sequence):
    complement = ""
    complements = {'A': 'T', 'T': 'A', 'G': 'C', 'C': 'G'}
    for char in dna_sequence:
        complement += complements[char]
    return complement

dna_sequence = ""
reversed_sequence = reverse_sequence(dna_sequence)
complement_sequence = complement_sequence(reversed_sequence)

print("Complement", complement_sequence)
